//ROUTERS ---->link specific components one page to another page ("link tag")
//applicable both claass and functions
import { BrowserRouter  as Router,Routes,Route,Link } from "react-router-dom";
import "./route.css"
function App4(){
    return(
        <div>
            <Router>
            <ul>
                <li>HOME</li>
                <li>ABOUT</li>
                <li>NOTICE</li>
                <li>CONTACT US</li>
                <li>HELP LINE</li>
            </ul>
            </Router>
        </div>
    )
}
export default App4;
